<html lang="zh-CN">

    <meta charset="UTF-8">

    <script src="https://cdn.jsdelivr.net/npm/echarts@5.4.3/dist/echarts.min.js"></script>
    <style>
        body {
            margin: 0;
            padding: 20px;
            font-family: 'Microsoft YaHei', Arial, sans-serif;
            background: linear-gradient(135deg, #1a1a2e 0%, #16213e 50%, #0f3460 100%);
            color: #ffffff;
            min-height: 100vh;
        }
        .container {
            max-width: 1800px;
            margin: 0 auto;
        }
        .header {
            text-align: center;
            margin-bottom: 30px;
            background: rgba(255, 255, 255, 0.08);
            padding: 25px;
            border-radius: 15px;
            backdrop-filter: blur(15px);
            border: 1px solid rgba(255, 255, 255, 0.1);
        }
        .header h1 {
            margin: 0 0 15px 0;
            color: #00d4ff;
            text-shadow: 0 0 30px rgba(0, 212, 255, 0.4);
            font-size: 2.2em;
        }
        .config-info {
            display: grid;
            grid-template-columns: repeat(auto-fit, minmax(200px, 1fr));
            gap: 15px;
            margin-top: 20px;
            padding: 20px;
            background: rgba(0, 0, 0, 0.2);
            border-radius: 10px;
        }
        .config-item {
            display: flex;
            justify-content: space-between;
            padding: 8px 12px;
            background: rgba(255, 255, 255, 0.05);
            border-radius: 6px;
            border-left: 3px solid #00d4ff;
        }
        .chart-container {
            width: 100%;
            height: 800px;
            background: rgba(255, 255, 255, 0.08);
            border-radius: 15px;
            padding: 20px;
            box-shadow: 0 10px 40px rgba(0, 0, 0, 0.4);
            backdrop-filter: blur(15px);
            border: 1px solid rgba(255, 255, 255, 0.1);
        }
        .legend {
            display: flex;
            justify-content: center;
            gap: 30px;
            margin-bottom: 25px;
            flex-wrap: wrap;
        }
        .legend-item {
            display: flex;
            align-items: center;
            gap: 10px;
            font-size: 15px;
            background: rgba(255, 255, 255, 0.08);
            padding: 10px 15px;
            border-radius: 8px;
            border: 1px solid rgba(255, 255, 255, 0.1);
        }
        .legend-color {
            width: 16px;
            height: 16px;
            border-radius: 4px;
            box-shadow: 0 0 10px rgba(255, 255, 255, 0.3);
        }
        .info-panel {
            background: rgba(255, 255, 255, 0.08);
            padding: 25px;
            border-radius: 15px;
            margin-top: 30px;
            backdrop-filter: blur(15px);
            border: 1px solid rgba(255, 255, 255, 0.1);
        }
        .info-grid {
            display: grid;
            grid-template-columns: repeat(auto-fit, minmax(220px, 1fr));
            gap: 15px;
        }
        .info-row {
            display: flex;
            justify-content: space-between;
            padding: 12px 15px;
            background: rgba(0, 0, 0, 0.3);
            border-radius: 8px;
            border-left: 4px solid #00d4ff;
        }
    </style>
</head>
<body>
    <div class="container">
        <div class="header">
            <h1>🎯 单周期SAR策略回测 - 1hK线图表</h1>
            <p style="color: #cccccc; font-size: 16px;">💫 1hSAR动态止损 + 固定止盈 | 🎯 真实回测数据 | 📊 交互式分析</p>
            
            <div class="config-info">

                </div>
                <div class="config-item">

                    <span style="color: #00d4ff; font-weight: bold;">6252</span>

                <div class="config-item">

        </div>

        <div class="legend">
            <div class="legend-item">

            </div>
        </div>

        <div class="chart-container">
            <div id="main-chart" style="width: 100%; height: 100%;"></div>
        </div>

        <div class="info-panel">
            <h3>📊 当前K线详情</h3>
            <div class="info-grid" id="currentInfo">
                <div class="info-row">
                    <span>🕐 时间:</span>
                    <span id="currentTime">点击K线查看详情</span>
                </div>
                <div class="info-row">
                    <span>📈 开盘:</span>
                    <span id="currentOpen">-</span>
                </div>
                <div class="info-row">
                    <span>⬆️ 最高:</span>
                    <span id="currentHigh">-</span>
                </div>
                <div class="info-row">
                    <span>⬇️ 最低:</span>
                    <span id="currentLow">-</span>
                </div>
                <div class="info-row">
                    <span>📉 收盘:</span>
                    <span id="currentClose">-</span>
                </div>
                <div class="info-row">
                    <span>🎯 1h SAR:</span>
                    <span id="currentSAR">-</span>
                </div>
            </div>
        </div>
    </div>
